import React, { useState } from 'react';
import { FaBars } from 'react-icons/fa';
import './CategoryBar.css';

const CategoryBar = () => {
    return (
        <div>
            <ul className='category-bar'>
                <li className='burger'><FaBars size={40} /></li>
                <li>한식</li>
                <li>중식</li>
                <li>일식</li>
                <li>양식</li>
                <li>카페 / 디저트</li>
            </ul>
        </div>
    )
}
export default CategoryBar;
